import React from 'react';
import Topbar from "../HomePage/Topbar";
import NavbarShop from "./NavbarShop";

const Header = () => {
    return (
        <div>
            <Topbar></Topbar>
            <NavbarShop></NavbarShop>
        </div>
    );
};

export default Header;
